@Component({
  selector: 'app-home',
  templateUrl: './home.component.html',
})
export class HomeComponent implements OnInit {
  constructor() { }
    ngOnInit() {
  }
}
<div class="col-12 text-center">
  <img class="navbar-brand-dark rotate-logo" src="./assets/img/brand/light.svg" height="120" alt="Logo light">
  <h1 class="display-1 mb-2">Rocket</h1>
  <h2 class="h3 text-muted mb-5">Bootstrap Startup Dashboard Template</h2>
  <div class="d-flex justify-content-center mb-6">
  <a href="./pages/index.html" class="btn btn-secondary animate-up-2 mr-4">
    <span class="fas fa-laptop mr-2 d-none d-sm-inline"></span> Front pages</a>
  <a href="./pages/dashboard/dashboard.html" class="btn btn-outline-white animate-up-2">
    <span class="fas fa-chart-line mr-2 d-none d-sm-inline"></span> Dashboard</a>
    </div><div class="d-flex justify-content-center flex-column mb-6">
  <a href="https://themesberg.com" target="_blank">
  <img src="./assets/img/themesberg.svg" class="d-block mx-auto mb-3" height="25" width="25" alt="Themesberg Logo">
  <span class="text-muted font-small">A Themesberg production</span></a>
      </div>
</div>
